import{_ as a,c as l,a0 as r,o as t}from"./chunks/framework.D-WqjATM.js";const p=JSON.parse('{"title":"Leaders2023","description":"","frontmatter":{},"headers":[],"relativePath":"projects/leaders2023/intro.md","filePath":"projects/leaders2023/intro.md"}'),i={name:"projects/leaders2023/intro.md"};function o(n,e,s,d,h,u){return t(),l("div",null,e[0]||(e[0]=[r('<h1 id="leaders2023" tabindex="-1">Leaders2023 <a class="header-anchor" href="#leaders2023" aria-label="Permalink to &quot;Leaders2023&quot;">​</a></h1><h2 id="update-17-05-2024" tabindex="-1">Update 17.05.2024 <a class="header-anchor" href="#update-17-05-2024" aria-label="Permalink to &quot;Update 17.05.2024&quot;">​</a></h2><ul><li>Перевел проект на yandex cloud</li><li>Postgres заменен на YDB</li><li>Frontend хранится и раздается из object storage</li><li>Backend работает на serverless containers</li><li>Образы хранятся в container registry yandex cloud</li><li>CI/CD github убрал, образы и запуск в yandex cloud делал вручную. Не было время это настраивать. Да и смысла делать это для архивного проекта нет</li></ul><p>Причины по которым переехал:</p><ul><li>В cloud.ru убрали с аккаунта бонусы, а аренда vps кажется дорогой для архивного проекта</li><li>В yandex cloud хранить такой проект получится дешево. Особенно если использовать serverless containers и YDB, потому что платить нужно только за фактическое использование ресурсов</li><li>Решил попробовать yandex cloud, serverless containers, YDB, потому что до этого не было такого опыта. В целом понравилось, будущие небольшие проекты скорее всего буду делать тут с этими технологиями</li></ul><hr><hr><p>Хакатон &quot;Лидеры цифровой трансформации&quot;</p><p>Мои цели:</p><ol><li>Сделать самому весь функционал приложения (Фронт + Бэк + БД + CI/CD + Покупка и настройка сервера)</li><li>В рамках хакатона сделать не только веб, но и мобильные приложения для ios и android</li><li>Протестировать проект starter, выявить его недостатки</li></ol><p>Исходя из целей была выбрана задача &quot;АГРЕГАТОР ПЛОЩАДОК И УСЛУГ КРЕАТИВНЫХ ИНДУСТРИЙ МОСКВЫ&quot;</p><h2 id="превью" tabindex="-1">Превью <a class="header-anchor" href="#превью" aria-label="Permalink to &quot;Превью&quot;">​</a></h2><ul><li>Приложение: <a href="https://leaders2023.upikoth.dev" target="_blank" rel="noreferrer">https://leaders2023.upikoth.dev</a></li><li>API: <a href="https://bbajpaj5dqmlhr4aa1nl.containers.yandexcloud.net/api/swagger/index.html" target="_blank" rel="noreferrer">https://bbajpaj5dqmlhr4aa1nl.containers.yandexcloud.net/api/swagger/index.html</a></li></ul><p>Авторизация. Телефоны для разных ролей:</p><ul><li>+7 (000) 000-00-01</li><li>+7 (000) 000-00-02</li><li>+7 (000) 000-00-03</li><li>+7 (000) 000-00-04</li><li>+7 (000) 000-00-05</li></ul><p>Пароль: 123</p><h3 id="какои-функционал-считаю-наиболее-интересным" tabindex="-1">Какой функционал считаю наиболее интересным <a class="header-anchor" href="#какои-функционал-считаю-наиболее-интересным" aria-label="Permalink to &quot;Какой функционал считаю наиболее интересным&quot;">​</a></h3><ul><li>Яндекс карты 3.0 (новое api, с которым не работал и то, как обошел проверку на Refferer)</li><li>Хранение картинок на s3. Потому что никогда до этого не оргинизовывал хранение сам.</li><li>Использование dadata. Интеграция позволила получать из адреса площадки координаты и таким образом обогащать данные. Просто хорошее решение.</li><li>Экспорт событий об аренде из сторонних календарей.</li><li>Нативные приложения на android и ios. Потому что сделать это в короткий срок просто круто))</li></ul><h2 id="стек" tabindex="-1">Стек <a class="header-anchor" href="#стек" aria-label="Permalink to &quot;Стек&quot;">​</a></h2><ul><li>Frontend: Vue3 + Ionic</li><li>Backend: Go + Postgres</li><li>CI/CD: Github CI + Docker + SberCloud</li></ul><h2 id="task-manager" tabindex="-1">Task manager <a class="header-anchor" href="#task-manager" aria-label="Permalink to &quot;Task manager&quot;">​</a></h2><ul><li><a href="https://github.com/users/upikoth/projects/4" target="_blank" rel="noreferrer">https://github.com/users/upikoth/projects/4</a></li></ul><h2 id="ссылки-на-репозитории" tabindex="-1">Ссылки на репозитории <a class="header-anchor" href="#ссылки-на-репозитории" aria-label="Permalink to &quot;Ссылки на репозитории&quot;">​</a></h2><ul><li>Frontend: <a href="https://github.com/upikoth/leaders2023-frontend" target="_blank" rel="noreferrer">https://github.com/upikoth/leaders2023-frontend</a></li><li>Backend: <a href="https://github.com/upikoth/leaders2023-backend" target="_blank" rel="noreferrer">https://github.com/upikoth/leaders2023-backend</a></li></ul><h2 id="результаты" tabindex="-1">Результаты <a class="header-anchor" href="#результаты" aria-label="Permalink to &quot;Результаты&quot;">​</a></h2><p>Все поставленные цели были выполнены, результатом стало 4ое место.</p><h2 id="дополнительные-материалы-по-задаче-и-результатам" tabindex="-1">Дополнительные материалы по задаче и результатам <a class="header-anchor" href="#дополнительные-материалы-по-задаче-и-результатам" aria-label="Permalink to &quot;Дополнительные материалы по задаче и результатам&quot;">​</a></h2><ul><li><a href="./tz.pdf">Техническое задание</a></li><li><a href="./docs.pdf">Сопроводительная документация</a></li><li><a href="./presentation.pdf">Презентация</a></li></ul>',28)]))}const b=a(i,[["render",o]]);export{p as __pageData,b as default};
